#include "OOLC.h"

static void sceneReady(scene& scn, player& p);
static void sceneEnd(scene& scn);
void nongchang(player& p) {
	scene nongchang;
	sceneReady(nongchang, p);
	nongchang.gameStart();
    //动画
    try {
        while (1) {
            nongchang.printMap();
 
            nongchang.playerDo();//其他按键功能
            nongchang.NPCDo();
            nongchang.playerMove();
            nongchang.NPCMove();
            nongchang.esc();

            Sleep(50);
        }
    }
    catch (int) {//换地图，地图文件存档

    }
    catch (const char*) {//退出
        p.exit = 1;
    }
    sceneEnd(nongchang);
}

